import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import SkillIcon from './components/SkillIcon';

ReactDOM.render(
	<React.StrictMode>
		<SkillIcon skill={'Python'} color={'blue'} />
	</React.StrictMode>,
	document.getElementById('root')
);
